posicao.forEach(function(pos, i) {
  pos.index = i;
});


var formatNumber = d3.format(".2f"),
    formatDefault = String;

var mediaScale = d3.scale.linear().domain([d3.min(posicao, function(d) { return d.esperado; })-0.01, d3.max(posicao, function(d) { return d.esperado; })+0.01]).range([0,120]),
    precoScale = d3.scale.linear().domain([d3.min(posicao, function(d) { return d.preco_cartoleta; })-0.01, d3.max(posicao, function(d) { return d.preco_cartoleta; })+0.01]).range([0, 150]),    
    esp_preco_Scale = d3.scale.linear().domain([d3.min(posicao, function(d) { return d.esperado_cartoleta; })-0.01, d3.max(posicao, function(d) { return d.esperado_cartoleta; })+0.01]).range([0, 90]),
    esp_desvio_Scale = d3.scale.linear().domain([d3.min(posicao, function(d) { return d.esperado_desvio; })-0.01, d3.max(posicao, function(d) { return d.esperado_desvio; })+0.01]).range([0, 80]),
    valorizacao_Scale = d3.scale.linear().domain([d3.min(posicao, function(d) { return d.variacao_cartoleta; })-0.001, d3.max(posicao, function(d) { return d.variacao_cartoleta; })+0.001]).range([0, 90]);

